import React from 'react';
import "../fonts.css";

const TitlePage = (() => {
    return (
        <div name='title'>
            <h3 className='pixel'>
                hello world!<br></br>
                my name is: 
            </h3>

            <h1>
                <span className='cursive '>E</span><span className='pixel'>MILY YU</span>
            </h1>
        </div>
    )
});

export default TitlePage;
